`;

const Label = styled.label`
  font-size: 1rem;
  font-weight: bold;
  margin-bottom: 0.5rem;
`;

const Input = styled.input`
  width: 330px;
  height: 35px;
  border-radius: 40px;
  border: 2.5px solid #6582fc;
  padding-left: 15px;
  font-size: 15px;
`;

const SaveButton = styled.button`
background-color: #6582fc;
width: 350px;
height: 70px;
border-radius: 22px;
border: none;
font-weight: 600;
color: white;
font-size: 22px;
margin-top: 2rem;
cursor: pointer;
`;

export default EditProfile;
